// src/components/About/About.js
import React from "react";
import "./About.css";

function About() {
  return (
    <section id="about" className="about">
      <h2>About Me</h2>
      <p>رائعة باستخدام React.
      </p>
      <div className="skills">
        <h3>مهاراتي:</h3>
        <ul>
          <li>HTML & CSS</li>
          <li>JavaScript</li>
          <li>React</li>
          <li>Figma</li>
        </ul>
      </div>
    </section>
  );
}

export default About;
